// And groups predicates with the AND operator between them.
func And(predicates ...predicate.ValidationCase) predicate.ValidationCase {
	return predicate.ValidationCase(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.ValidationCase) predicate.ValidationCase {
	return predicate.ValidationCase(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.ValidationCase) predicate.ValidationCase {
	return predicate.ValidationCase(sql.NotPredicates(p))
}
